import Header from "./Header";

const GlobalStyles = createGlobalStyle`
html {
  --red: #ff1234;
  --black: #393939;
  --grey: #3a3a3a;
  --gray: var(--grey);
  --lightGrey: #e1e1e1;
  --lightGray: var(--lightGrey);
}
`


export default function Page({children}) {
  return (
    <div>
        <Header/>
      <h2> I am the page component</h2>
      {children}
    </div>
  );
}
